import React, { Component } from "react";
import Main from "../pages/main";
import Header from "../header/header";

import "./App.css";

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }

  componentDidMount() {
    return fetch(
      "http://localhost:8888/textTasks/wordpress-savigor/wp-json/wp/v2/posts"
    ).then((res) => console.log(res.json()));
  }

  render() {
    return (
      <div className="App">
        <Header />
        <Main />
      </div>
    );
  }
}
